import React from "react";


const Recipe= ({allRecipes})=>{

    return (
        <div>
            {
                allRecipes.map(r=>(
                    <div>
                        {r.image},
                        {r.name},
                        {r.diets.map(d=>( <p key={r.id}>{d}</p>))}
                        </div>

                ))
            }
        </div>
    )
}

export default Recipe;
